function ChangePassword(){let e=document.getElementById("InputEmail").value,t=document.getElementById("InputPassword").value,s=JSON.parse(localStorage.getItem("AccountData"));for(let a=0;a<Object.values(s.users).length;a++)s.users[a].email==e&&(s.users[a].password=t,alert("Password Changed to"+t));localStorage.setItem("AccountData",JSON.stringify(s))}